webpackJsonp([0x69894840e631],{392:function(e,n){e.exports={data:{markdownRemark:{html:'<p>When you reject an invitation to a private program, you\'ll have the option to fill out a rejection questionnaire to share your feedback with HackerOne. </p>\n<p>At HackerOne we believe in transparency, and in this case, it includes giving programs the reason why hackers are not interested in engaging with them. Your feedback will help programs understand why hackers don\'t want to participate in their programs and can better help them to modify their programs so that hackers will want to hack in them. </p>\n<h3>How to Fill out the Questionnaire</h3>\n<p>To access the questionnaire, decline the invitation, and the questionnaire will directly appear. </p>\n<p>*Note: You must fill out the questionnaire immediately. You can\'t save and come back to it later. </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/docs.hackerone.com/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-da44b.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.832662912308926%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="invitation-rejection-questionnaire-1"\n        title=""\n        src="/docs.hackerone.com/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-e7ffa.png"\n        srcset="/docs.hackerone.com/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-49813.png 125w,\n/docs.hackerone.com/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-dc8a5.png 250w,\n/docs.hackerone.com/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-e7ffa.png 500w,\n/docs.hackerone.com/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-dda24.png 750w,\n/docs.hackerone.com/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-c5f18.png 1000w,\n/docs.hackerone.com/static/invitation-rejection-questionnaire-1-f9c222f302e0d31190164e74612f89cd-da44b.png 1243w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/docs.hackerone.com/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-9fbee.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 174.05329593267885%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="invitation-rejection-questionnaire-2"\n        title=""\n        src="/docs.hackerone.com/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-e7ffa.png"\n        srcset="/docs.hackerone.com/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-49813.png 125w,\n/docs.hackerone.com/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-dc8a5.png 250w,\n/docs.hackerone.com/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-e7ffa.png 500w,\n/docs.hackerone.com/static/invitation-rejection-questionnaire-2-1dcb8ab29b83e12c0b337f3d074b7a02-9fbee.png 713w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>The questionnaire is completely voluntary, but if you fill it out, you\'ll get priority for another invitation so that you can find a program that is a better fit. </p>\n<p>If you\'ve rejected an invitation to a program, you can manually be invited back into the program. [CHECK THIS INFO WITH SONYA]</p>',frontmatter:{path:"/hackers/invitation-rejection-questionnaire",title:"Invitation Rejection Questionnaire"}}},pathContext:{}}}});
